## this file is run after SherwoodMartirosyanColbournCPHF.R
## it creates the list CL_SCPHFs
## and extends the data frame SCPHFcat that was created there

pfadGithub <- "https://raw.githubusercontent.com/aadwyer/CA_Database/main/Repository/CPHF/compact/"
## list.files(path=pfadGithub) does not work

filelist <- read.csv2("SCPHF\\CPHF_Liste25August2025.csv")[,1,drop=FALSE]
filelist <- filelist[!filelist$filename=="",, drop=FALSE]
head(filelist)
tail(filelist)

filelist$filename <- gsub(".txt", "", filelist$filename, fixed=TRUE)

fileinfos <- as.data.frame(do.call(rbind, strsplit(filelist$filename, "_", fixed=TRUE)))
fileinfos$V1 <- NULL
colnames(fileinfos) <- c("n","t", "k", "vtothetm1")
fileinfos$n <- as.numeric(fileinfos$n)
fileinfos$t <- as.numeric(fileinfos$t)
fileinfos$k <- as.numeric(fileinfos$k)
fileinfos$vtothetm1 <- as.numeric(fileinfos$vtothetm1)
fileinfos$v <- fileinfos$vtothetm1^(1/(fileinfos$t-1))
fileinfos$N <- fileinfos$n*(fileinfos$v^fileinfos$t-fileinfos$v) + fileinfos$v

sum(xtabs(~v+N, data=fileinfos)>0)
## each N occurs exactly with one v (and for one strength)
fileinfos$best <- NA
for (N in unique(fileinfos$N)){
  fileinfos$best[fileinfos$N==N] <- FALSE
  fileinfos$best[fileinfos$N==N][which.max(fileinfos$k[fileinfos$N==N])] <- TRUE
}

## download the best CPHFs
for (i in 1:nrow(fileinfos))
  if (fileinfos$best[i]){
    nam <- paste0(paste(c("CPHF", fileinfos$n[i], fileinfos$t[i], fileinfos$k[i], fileinfos$vtothetm1[i]), collapse="_"), ".txt")
   mycon <- file(paste0(pfadGithub, nam), "r")
   myconw <- file(paste0("SCPHF/", nam), "w")
   gelesen <- readLines(mycon)
   writeLines(gelesen, myconw)
   close(mycon)
   close(myconw)
  }
## files were copy-pasted instead of read

hilf <- fileinfos[which(fileinfos$best),]
hilf$best <- NULL
hilf <- hilf[DoE.base::ord(hilf[,c("t","v","k")]),]
hilf$type <- "2018"
colnames(hilf)
hilf$n <- NULL
hilf$vtothetm1 <- NULL

